  title: "Components/Button",
  component: Button,
} as ComponentMeta<typeof Button>;

export const Buttons: ComponentStory<typeof Button> = (args: ButtonProps) => {
  return (
    <>
      <Button type="primary">Button</Button>
      <Button type="secondary">Button</Button>
    </>
  );
};



